var ent=scriptletInput.split("\n");
var salida="";
var acumvv=0;
var acumvm=0;
var countvv=0;
var countvm=0;
var acumdv=0;
var acumdm=0;
var countdv=0;
var countdm=0;
var acumrvm=0;
var countrvm=0;
