var countdevm=0;
var acumdevv=0;
var countdevv=0;

for(i=0;i<ent.length;i++){
 lin=ent[i].split(",");
 if(lin[9].search(/^75\d+/g)!=-1){ //mastercard
 	if(lin[15].search(/^02/g)!=-1){//disposiciones
 		acumdm+=parseFloat(lin[16]).toFixed(2)/100;
 		countdm++;
 	}else if(lin[15].search(/^01/g)!=-1){ //ventas
 		acumvm+=parseFloat(lin[16]).toFixed(2)/100;
 		countvm++;
 	}else if(lin[15].search(/^21/g)!=-1){ //Devoluciones
 		acumdevm+=parseFloat(lin[16]).toFixed(2)/100;
 		countdevm++;
 	}else if(lin[15].search(/^26/g)!=-1){ //reverso devoluciones
 	 	acumrdm+=parseFloat(lin[16]).toFixed(2)/100;
 	 	countrdm++;
 	}else if(lin[15].search(/^25/g)!=-1){ //reverso ventas
 		acumrvm+=parseFloat(lin[16]).toFixed(2)/100;
 		countrvm++;
 	}

 }else if(lin[9].search(/^74\d+/g)!=-1){//Visa
 	if(lin[15].search(/^02/g)!=-1){//disposiciones
 		acumdv+=parseFloat(lin[16]).toFixed(2)/100;
 		countdv++;
  	}else if(lin[15].search(/^01/g)!=-1){ //ventas
  		acumvv+=parseFloat(lin[16]).toFixed(2)/100;
  		countvv++;
  	}else if(lin[15].search(/^21/g)!=-1){ //Devoluciones
  		acumdevv+=parseFloat(lin[16]).toFixed(2)/100;
  	 	countdevv++;
  	}else if(lin[15].search(/^26/g)!=-1){ //reverso devoluciones
  		acumrdv+=parseFloat(lin[16]).toFixed(2)/100;
  	 	countrdv++;
  	}else if(lin[15].search(/^25/g)!=-1){ //reverso ventas
  		acumrvv+=parseFloat(lin[16]).toFixed(2)/100;
  	 	countrvv++;
  	}
 }
}

salida="Ventas Master: "+acumvm.toFixed(2) + " " + countvm + "\nDisposiciones Master: "+acumdm.toFixed(2)+" " + countdm;
